import React from 'react';
import {Row, Col } from 'reactstrap';
import {AboutContainer,AboutH1,Img,Content} from './AboutElements';
import img from '../images/ABOUT.svg'

const About = () => {
    return (
        <AboutContainer>
            <Col xs="12">
            <AboutH1>ABOUT ME</AboutH1>
            </Col>
            <Col xs={{size:10, offset:1}} sm={{size:8, offset:2}}>
            <Row>
            <Content>안녕하세요, 저는 웹 프론트엔드 개발자 임정우입니다.
            반응형 웹을 만드는 것을 좋아하고 다양한 Ul/UX 디자인에 관심이 많습니다.
            </Content>
            </Row>
            </Col>
            <Img src={img} />
            <div>안녕하세요</div>
        </AboutContainer>
    )
}

export default About;
